<script>
// Add styles for the visualization
const styles = `
.node { cursor: pointer; }
.link { stroke: #999; stroke-opacity: 0.6; }
.node text { font-size: 10px; font-family: sans-serif; }
.tooltip {
position: absolute;
padding: 8px;
background: rgba(0, 0, 0, 0.8);
color: white;
border-radius: 4px;
font-size: 12px;
pointer-events: none;
}
`;
document.querySelector('style').textContent += styles;

// Create tooltip
const tooltip = d3.select('body')
.append('div')
.attr('class', 'tooltip')
.style('opacity', 0);

// Process data for network visualization
function processData(data) {
const nodes = [];
const links = [];
const communities = data.bridging_users.all_communities;
const users = data.bridging_users.bridging_users;

// Add community nodes
communities.forEach(comm => {
nodes.push({
id: `comm-${comm.community_id}`,
type: 'community',
size: comm.size,
communityId: comm.community_id
});
});

// Add user nodes and links
users.forEach(user => {
const userId = user.user_node;
nodes.push({
id: userId,
type: 'user',
connections: user.connected_communities.length,
steamid: user.user_data.data.steamid
});

// Create links between users and communities
user.connected_communities.forEach(commId => {
links.push({
source: userId,
target: `comm-${commId}`
});
});
});

return { nodes, links };
}

// Create the visualization
function createNetworkGraph(data) {
const { width, height } = getDimensions();
const networkData = processData(data);

// Color scale for communities
const colorScale = d3.scaleOrdinal(d3.schemeCategory10);

// Create force simulation
const simulation = d3.forceSimulation(networkData.nodes)
.force('link', d3.forceLink(networkData.links).id(d => d.id))
.force('charge', d3.forceManyBody().strength(-100))
.force('center', d3.forceCenter(width / 2, height / 2))
.force('collision', d3.forceCollide().radius(d => getNodeRadius(d) + 2));

// Create links
const link = g.selectAll('.link')
.data(networkData.links)
.join('line')
.attr('class', 'link');

// Create nodes
const node = g.selectAll('.node')
.data(networkData.nodes)
.join('g')
.attr('class', 'node')
.call(d3.drag()
.on('start', dragstarted)
.on('drag', dragged)
.on('end', dragended));

// Add circles to nodes
node.append('circle')
.attr('r', getNodeRadius)
.attr('fill', d => d.type === 'community' ? 
colorScale(d.communityId) : 
d3.interpolateViridis(d.connections / 10))
.attr('stroke', '#fff')
.attr('stroke-width', 1.5);

// Add labels to nodes
node.append('text')
.attr('dx', d => getNodeRadius(d) + 5)
.attr('dy', '.35em')
.text(d => d.type === 'community' ? 
`Community ${d.communityId}` : 
`User ${d.steamid}`);

// Add hover interactions
node.on('mouseover', (event, d) => {
tooltip.transition()
.duration(200)
.style('opacity', .9);
tooltip.html(`${d.type === 'community' ? 
`Community ${d.communityId}<br/>Size: ${d.size}` : 
`User ${d.steamid}<br/>Communities: ${d.connections}`}`)
.style('left', (event.pageX + 10) + 'px')
.style('top', (event.pageY - 28) + 'px');
})
.on('mouseout', () => {
tooltip.transition()
.duration(500)
.style('opacity', 0);
});

// Update positions on simulation tick
simulation.on('tick', () => {
link
.attr('x1', d => d.source.x)
.attr('y1', d => d.source.y)
.attr('x2', d => d.target.x)
.attr('y2', d => d.target.y);

node
.attr('transform', d => `translate(${d.x},${d.y})`);
});

// Drag functions
function dragstarted(event) {
if (!event.active) simulation.alphaTarget(0.3).restart();
event.subject.fx = event.subject.x;
event.subject.fy = event.subject.y;
}

function dragged(event) {
event.subject.fx = event.x;
event.subject.fy = event.y;
}

function dragended(event) {
if (!event.active) simulation.alphaTarget(0);
event.subject.fx = null;
event.subject.fy = null;
}

// Helper function to determine node radius
function getNodeRadius(d) {
if (d.type === 'community') {
return Math.sqrt(d.size) * 2 + 5;
} else {
return Math.sqrt(d.connections) * 2 + 3;
}
}
}

// Initialize the visualization
createNetworkGraph(data.bridging_users);
</script>
